            <img className="login-image" alt ="banner" src="assets/img/banner.png"/>

        </div>
        <div className="login-right">
            <div>
                <div className="img-class">
                    <img className="login-logo" alt= "logo" src="assets/img/kv-logo.png"/>
                </div>
                <form>

                <Input label='username' value='' type='text' onChange={()=>{}}/><br></br>
                <Input label='password' value='' type='password' onChange={()=>{}}/>
                </form> 
            </div>


        </div>
    </section>
    )
}

export default Login;
